  false,\n\t\"url\": null,\n\t\"notes\": \"Plans for farming and grazing at Monte
  Vista National Wildlife Refuge for 1993.  This program will use rotations of small
  grain, field peas, and legumes as a farming tool to provide food and cover for a
  variety of wildlife as well as to provide a show place for sustainable agriculture
  using no pesticide or synthetic fertilizers.  The grazing program is extensively
  planned management of livestock to achieve refuge goals and objectives.  Biological
  plan and control charts as well as maps of grazing unit plans are included.\",\n\t\"owner_org\":
